import {
  init_esm_shims
} from "./chunk-WWCIODDN.js";

// Commands/Admin/getOwner.ts
init_esm_shims();
import { EmbedBuilder, PermissionFlagsBits, SlashCommandBuilder } from "discord.js";
var command = {
  data: new SlashCommandBuilder().setName("fetchowner").setDescription("Fetch the owner of this discord Server").setDefaultMemberPermissions(PermissionFlagsBits.Administrator),
  async execute(interaction, client) {
    const owner = await interaction.guild.fetchOwner();
    const embed = new EmbedBuilder({
      title: "JSON",
      description: `\`\`\`json
${JSON.stringify((await owner.fetch()).toJSON(), null, 3)}
\`\`\``
    });
    await interaction.reply({ content: `Owner: ${owner}
Username: **${owner.user.username}**
UserID: **${owner.user.id}**
Display-Name: **${owner.displayName}**
`, embeds: [embed], ephemeral: true });
  }
};
var getOwner_default = command;
export {
  getOwner_default as default
};
